import React, { useState } from "react";
import axios from "axios";
import Plantilla from ""

export default class fetchNoticias extends React.Component {
  state = {
    loading: true,
    Equipo: "",
    Jugadores: [],
  };

  componentDidMount() {}
  handleEquipo(string) {
    this.setState({
      Equipo: string,
    });
  }
  async componentDidMount() {
    const url =
      "http://localhost:8000/api/Jugadores/?search=" + this.state.Equipo;
    console.log(this.state.Equipo);
    const response = await axios.get(url);
    const data = await response.data;

    this.setState({ Jugadores: data });
  }
  customEvent(event) {
    alert("hola" + event);
  }

  render() {
    return <ChildComponent customEvent={this.customEvent} />;
  }
}
